    constructor(categoryService) {
        this.categoryService = categoryService;
        this.asyncTabs = new Observable((observer) => { });
    }
    ngOnInit() {
    }
};
CategorySwitchComponent = __decorate([
    Component({
        selector: 'app-category-switch',
        templateUrl: './category-switch.component.html',
        styleUrls: ['./category-switch.component.css']
    })
], CategorySwitchComponent);
export { CategorySwitchComponent };
